import React from 'react';
import './style.scss';

class Services extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <section id="services">
                <div className="row">
                    <div className="col-sm-3">
                        <div className="card">
                            <div className="card-body">
                                <h5 className="card-title">Special title treatment</h5>
                            </div>
                        </div>
                    </div>
                    <div className="col-sm-3">
                        <div className="card">
                            <div className="card-body">
                                <h5 className="card-title">Special title treatment</h5>
                            </div>
                        </div>
                    </div>
                </div>
            </section>

        )
    }
}

export default Services;
